1932年から75年に渡り、世界の名車のオーナーに愛され続けたNARDI（ナルディ）のステアリング。イタリアの職人によってひとつひとつ丹念に作られたそのステアリングは、官能的な迄にドライバーの手に馴染み、その機能的なデザインは車と一体感のあるドライビングを生み出します。 <br><br>ナルディの歴史はここから始まりました。軽快でしなやかな操舵感。エンツォ・フェラーリやフェルディナント・ポルシェが愛したステアリングは、今もあらゆるパイロットたちの心を魅了し続けています。<br><br>●直径：360φ（mm） ●カラー：ウッドグリップ/シルバースポーク ●NARDIホーンボタン、ホーンリング、ビス付属 ●純正ステアリングから交換する場合には別途ボスが必要になります。 <br><br>対応車種：汎用品 <br><br>車検対応品<br><br>インテリア/ステアリング<tr><td colspan="2">
